// ==UserScript==
// @name           Dzwiękowe powiadomienie PW
// @description    Modyfikacja uruchamia dzwięk po przyjściu nowej wiadomości
// @namespace      http://www.fotka.pl/profil/suchar/
// @include        http://www.fotka.pl/wiadomosci*
// @version        1.0
// @copyright      2013+, suchar
// @author         suchar
// @run-at         document-end
// @grant          unsafeWindow
// @grant          GM_getValue
// @grant          GM_setValue
// ==/UserScript==
var u = unsafeWindow;
var $ = u.$;
var dzwiek_tmp = "";
var dzwiek = GM_getValue("dzwiek", dzwiek_tmp);
var nazwa = GM_getValue("nazwa", "domyślny");
var typ = GM_getValue("typ", "wav");

function wstaw_typ(typ) {
    switch (typ)
    {
        case "wav":
            return "x-wav";
            break;
        case "ogg":
            return "ogg";
            break;
        case "mp3":
            return "mp3";
            break;
    }
}
function newElem(type){
    return document.createElement(type);
}

var audioN = newElem("audio");
audioN.id = "audiotag";
audioN.src = "data:audio/"+wstaw_typ(typ)+";base64,"+dzwiek;
audioN.preload = "auto";
$('#header-logo').append(audioN);

var licznik = $('#header-pw-counter .pill-widget-value');
var ile_bylo; 
if (licznik[0]) {
    ile_bylo = licznik[0].innerHTML;
} else {
    ile_bylo = 0;
}
function sprawdzaj() {
    var ile_jest;
    if ($('#header-pw-counter .pill-widget-value')[0]) {
        ile_jest = $('#header-pw-counter .pill-widget-value')[0].innerHTML;
    } else {
        ile_jest = 0;
    }
    if (ile_bylo != ile_jest){
        ile_bylo = ile_jest; 
        u.document.getElementById('audiotag').play();
    }
    setTimeout(sprawdzaj, 1000);
}

var b = newElem("img");
b.src = "data:image/png;base64,";
b.id = "nutka";
b.style.position = "absolute";
b.style.right = "5px";
b.style.top = "60px";
b.style.cursor = "pointer";
b.style.zIndex = "1";
$("#two-column-right").prepend(b);
u.document.getElementById('nutka').addEventListener("click", konfig, false);

function konfig() {
    //<div class="fotkaLightBoxObscure">
    var div1 = newElem("div");
    div1.id = 'pwObscure';
    div1.setAttribute('class', 'fotkaLightBoxObscure');
    //<div id="pwContainer" class="fotkaLightBoxContainer pwclass" style="top: 40px;"> 
    var div2 = newElem("div");
    div2.className = "fotkaLightBoxContainer pwclass";
    div2.style.cssText = "top: 40px;";
    div1.appendChild(div2);
    //<div class="fotkaLightBox" style="width: 400px;">
    var div3 = newElem("div");
    div3.className = "fotkaLightBox";
    div3.style.cssText = "width: 400px;";
    div2.appendChild(div3);
    //<div id="fotkaLightBoxClose" class="icos24"></div>
    var div4 = newElem("div");
    div4.id = "fotkaLightBoxClose";
    div4.className = "icos24";
    div4.addEventListener('click', function(){u.document.body.removeChild(div1);}, false);
    div3.appendChild(div4);
    //<div class="fotkaLightBorder">
    var div5 = newElem("div");
    div5.className = "fotkaLightBorder";
    div3.appendChild(div5);
    //<div id="pwBox" class="fotkaLightContent" style="padding: 20px;">
    var div6 = newElem("div");
    div6.className = "fotkaLightContent";
    div6.style.cssText = "padding: 20px;";
    div5.appendChild(div6);

    var label = newElem("label");
    label.id = "nazwaLabel";
    label.innerHTML = "Aktualnie wgrany plik: "+nazwa+"."+typ+"<br>";
    div6.appendChild(label);
    var button_import = newElem("input");
    button_import.type = "button";
    button_import.className = "button";
    button_import.id = "button_import";
    button_import.value = "Wczytaj nowy plik";
    button_import.style.marginTop = "5px";
    button_import.style.marginLeft = "4px";
    button_import.addEventListener('click', wczytaj_dzwiek, false);
    div6.appendChild(button_import);
    var audio = newElem("audio");
    audio.id = "audiotag1";
    audio.src = "data:audio/"+wstaw_typ(typ)+";base64,"+dzwiek;
    audio.preload = "auto";
    div6.appendChild(audio);
    var play = newElem("img");
    play.src = "data:image/png;base64,";
    play.id = "play";
    play.style.position = "absolute";
    play.style.left = "12px";
    play.style.top = "31px";
    play.style.cursor = "pointer";
    play.addEventListener('click', function(){u.document.getElementById('audiotag1').play();}, false);
    div6.appendChild(play);
    u.document.body.appendChild(div1);
}

function wczytaj_dzwiek(){
    var button_import_plik = newElem("input");
    button_import_plik.type = "file";
    button_import_plik.click();
    button_import_plik.onchange = function(event) {
        var fileList = button_import_plik.files;
        if (fileList[0].type.match('audio.*')) {
            var reader = new FileReader();
            reader.onloadend = function(evt) {
                if (evt.target.readyState == FileReader.DONE) {
                    var tmp = evt.target.result;
                    var odpowiedz = btoa(tmp);
                    console.log("Nazwa: "+fileList[0].name+" Typ: "+fileList[0].type+" Długość przed: "+fileList[0].size+" Długość po: "+odpowiedz.length);
                    dzwiek = odpowiedz;
                    GM_setValue("dzwiek", odpowiedz);
                    nazwa = fileList[0].name.split(".")[0];
                    GM_setValue("nazwa", nazwa);
                    typ = fileList[0].type.split("/")[1];
                    GM_setValue("typ", typ);
                    u.document.getElementById('audiotag').src = "data:audio/"+wstaw_typ(typ)+";base64,"+dzwiek;;
                    u.document.getElementById('audiotag1').src = "data:audio/"+wstaw_typ(typ)+";base64,"+dzwiek;;
                    u.document.getElementById('nazwaLabel').innerHTML = "Aktualnie wgrany plik: "+nazwa+"."+typ+"<br>";
                }
            }
            reader.readAsBinaryString(fileList[0]);
        } else {
            alert("Nieprawidłowy typ pliku.\nDozwolone pliki to wav, mp3, ogg");
        }
    }
}
sprawdzaj();